import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './store';
import Header from './components/Layout/Header';
import Departments from './components/Departments';
import AddDepartment from './components/departments/AddDepartment';
import UpdateDepartment from './components/departments/UpdateDepartment';
import DepartmentBoard from './components/DepartmentBoard';
import AddEmployee from './components/employees/AddEmployees';
import UpdateEmployee from './components/employees/UpdateEmployees';
import EmployeeBoard from './components/EmployeeBoard';
import AddTaskForm from './components/tasks/AddTaskForm';
import UpdateTask from './components/tasks/UpdateTask';
import Landing from './components/Landing';
import Login from './components/LogIn';
import Register from './components/Register';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Check if the user is authenticated when the component mounts
    const userLoggedIn = localStorage.getItem('userLoggedIn');
    console.log('User logged in:', userLoggedIn); // Add this line for debugging
    if (userLoggedIn === 'true') {
      setIsAuthenticated(true);
    } else {
      setIsAuthenticated(false);
    }
  }, []);

  return (
    <Provider store={store}>
      <Router>
        <div>
          <Routes>
            <Route path="/" element={<Landing />} />
            <Route path="/login" element={<Login setIsAuthenticated={setIsAuthenticated} />} />
            <Route path="/register" element={<Register />} />
            <Route
              path="/departments/*"
              element={
                <>
                  <Header />
                  <Routes>
                    <Route index element={<Departments />} />
                    <Route path="addDepartment" element={<AddDepartment />} />
                    <Route path="updateDepartment/:id" element={<UpdateDepartment />} />
                    <Route path="employees/:id" element={<DepartmentBoard />} />
                    <Route path="addEmployee/:id" element={<AddEmployee />} />
                    <Route path="updateEmployee/:dep_id/:id" element={<UpdateEmployee />} />
                    <Route path="employeeBoard/:dep_id/:emp_id" element={<EmployeeBoard />} />
                    <Route path="addTask/:dep_id/:emp_id" element={<AddTaskForm />} />
                    <Route path="updateTask/:dep_id/:emp_id/:id" element={<UpdateTask />} />
                  </Routes>
                </>
              }
            />
            <Route
              path="/employees/*"
              element={
                <>
                  <Header />
                  <Routes>
                    <Route index element={<EmployeeBoard />} />
                    <Route path="addEmployee/:id" element={<AddEmployee />} />
                    <Route path="updateEmployee/:dep_id/:id" element={<UpdateEmployee />} />
                    <Route path="employeeBoard/:dep_id/:emp_id" element={<EmployeeBoard />} />
                    <Route path="addTask/:dep_id/:emp_id" element={<AddTaskForm />} />
                    <Route path="updateTask/:dep_id/:emp_id/:id" element={<UpdateTask />} />
                  </Routes>
                </>
              }
            />
            <Route
              path="/tasks/*"
              element={
                <>
                  <Header />
                  <Routes>
                    <Route index element={<AddTaskForm />} />
                    <Route path="updateTask/:dep_id/:emp_id/:id" element={<UpdateTask />} />
                  </Routes>
                </>
              }
            />
            {isAuthenticated ? (
              // Redirect to the home page if authenticated
              <Route path="*" element={<Navigate to="/departments" />} />
            ) : (
              // Redirect to login if not authenticated
              <Route path="*" element={<Navigate to="/login" />} />
            )}
          </Routes>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
